import React from 'react';

function VideoTable({ videos }) {
  return (
    <table>
      <thead>
        <tr>
          <th>Title</th>
          <th>Video</th>
        </tr>
      </thead>
      <tbody>
        {videos.map((video) => (
          <tr key={video.id}>
            <td>{video.title}</td>
            <td>
              <iframe
                title={video.title} 
                width="560"
                height="315"
                src={video.url}
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
              ></iframe>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default VideoTable;
